import React, { Component } from "react";

class EditCharacter extends Component {
  render() {
    console.log(this.props.show);
    return (
      <React.Fragment>
        {this.props.show && (
           <div class="modal fade bd-example-modal-lg" tabindex="-1" role="dialog" aria-labelledby="myLargeModalLabel" aria-hidden="true">
           <div class="modal-dialog modal-lg">
             <div class="modal-content">
             <form method="POST" action="/">
                <input value={this.props.name}></input>
                <input value={this.props.status}></input>
                <input value={this.props.species}></input>
                <input value={this.props.type}></input>
                <input value={this.props.gender}></input>
                <input type="submit" value="Change"></input>
                <input onClick={this.props.onHide}>Close</input>

                </form>
             </div>
           </div>
         </div>
        )}
      </React.Fragment>
    );
  }
}

export default EditCharacter;
